import numpy as np
# from numba import njit


# @njit('(i4[:,:],i4[:],i4[:])')
def calc(a, S, T):
    MOD = 10 ** 9 + 7
    for i in range(1, a.shape[0]):
        for j in range(1, a.shape[1]):
            a[i, j] = a[i - 1, j] + a[i, j - 1]
            if S[i - 1] != T[j - 1]:
                a[i, j] -= a[i - 1, j - 1]
            a[i, j] %= MOD


def main():
    N, M = map(int, input().split())
    S = np.fromstring(input(), dtype=np.int32, sep=' ')
    T = np.fromstring(input(), dtype=np.int32, sep=' ')
    a = np.ones((N + 1, M + 1), dtype=np.int32)
    calc(a, S, T)
    print(a[N, M])


if __name__ == "__main__":
    atcoder={
        'name': 'numba_modules',
        'file': 'numba_modules.cpython-34m.so',
        'func': ['calc'],
        'gz': b''
    }
    import gzip, base64
    gz = gzip.decompress(base64.b64decode(atcoder['gz']))
    with open(atcoder['file'], 'wb') as f:
        f.write(gz)
    from numba_modules import calc
    main()